void run(void){
  int n,k,q;
  scanf("%d%d%d",&n,&k,&q);
  int *a=(int *)calloc(n,sizeof(int));
  int i;
  for(i=0;i<n;i++) scanf("%d",a+i);
  heap *h=newHeap(sizeof(int),cmp);
  int *b=(int *)calloc(n,sizeof(int));
  int ans=1000000000;
  for(i=0;i<n;i++){
    int len=0;
    int j=0;
    while(j<n){
      initHeap(h);
      while(j<n && a[j]>0) push(h,a+j++);
      while(getSize(h)>=k){
	int v;
	pop(h,&v);
	b[len++]=v;
      }
      j++;
    }
    if(len<q) break;
    qsort(b,len,sizeof(int),cmp);
    int t=b[q-1]-b[0];
    if(ans>t) ans=t;
    for(j=0;a[j]==0;j++);
    int min=j;
    for(j++;j<n;j++) if(a[j]>0 && a[j]<a[min]) min=j;
    a[min]=0;
  }
  printf("%d\n",ans);
}
